import React from 'react';
import { useNavigate } from 'react-router';
import Button from '../../atoms/Button';

export default function ButtonsToRedirect() {
  const navigate = useNavigate();

  function redirectToCustomerPage() {
    navigate('/customers');
  }

  function redirectToProductsPage() {
    navigate('/products');
  }

  function redirectToSalesPage() {
    navigate('/Sales');
  }

  return (
    <div>
      <Button text="Clientes" onClick={ () => redirectToCustomerPage() } />
      <Button text="Produtos" onClick={ () => redirectToProductsPage() } />
      <Button text="Vendas" onClick={ () => redirectToSalesPage() } />
    </div>
  );
}
